import React, {Component}   from 'react';
import './App.css';
import Titulo from './components/title';
import Menu  from './components/navbar';
import Title from './components/title';
import NavBar from './components/navbar';

function App() {
  return(   
   <div className="App">
        <header className="App-header">                    
            <Title/>
            <NavBar/>
        </header>
    </div>
  );
}

export default App;
